Legendary Assassin (2009)
Alternatieve titels: Long Nga, Wolf Fang 

Hongkong
Actie / Thriller
89 minuten

geregisseerd door Chung Chi Li en Jacky Wu
met Jacky Wu, Alex Fong en Sammy Leung

Holly, een agente die trots is op het werk dat ze doet, komt vast te zitten in een boom, terwijl ze een kat probeert te redden. Bruce, een mysterieuze kung-fu meester, die niet van het eiland af kan vanwege het slechte weer, helpt Holly van die boom af. Ondanks het noodweer, patrouilleert Holly over het eiland. Ze ontdekt dat vier ontsnapte gevangenen zich schuil houden op het eiland. Samen met Bruce weet zij die echter vast te pakken. Nu Bruce een modelburger is geworden, krijgt hij lof voor zijn acties. De teruggekeerde rust op het eiland wordt ruw verstoord door de komst van een groep onbetrouwbare figuren, die hoogstwaarschijnlijk voor de maffia werken. Ze zoeken het hele eiland af op zoek naar Bruce. Als Bruce blijkt te zijn verdwenen, na de vondst van een lijk, weet Holly niet meer wie ze moet vertrouwen.

